  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"March 26, 2007    Daniel Buckley  Federal
    Election Commission  Washington DC 20463    Re:\tYear End Report  (November 28,
    to December 31, 2006)    Pursuant to your letter dated, February 23, 2007, regarding
    the End Of Year Report, we are responding to your questions as follows:    Beginning
    cash reflected is the same as our Amended Post General Report as amended on March
    26, 2007.  Year to date totals are corrected to reflect amended reports for activity
    from April 1, 2006 to December 31, 2006.    Schedule D debts have been corrected
    for Logix Communications, Aristotle International and Convio, Inc.    Allocated
    activity reported on H4 year to date totals are correct on lines 21ai and 21aii.
    \   As a result of software upgrade on March 5, 2007, we are no longer able to
    sort our data based on date of expenditure.   The software program however, reflects
    a date total on each record.  Consequently, each record shows a  year to date
    total for the type of activity based on date, but the random reporting by name
    of the expenditures, makes the year to date totals appear incorrect.  After careful
    reconciliation of each activity, the totals reflected on lines 21ai and 21aii
    are correct for the allocated expenditures.  All transfers which were not made
    within the 70 day time period have been returned to the non-federal account as
    previously reported.      H4 expenditure to the Unites States Postal Service is
    for administrative expenses and the description has been corrected.     Respectfully
    submitted, Wayne Tucker, Treasurer\""
